import { Route, Switch } from 'react-router-dom'
import Landing from './components/Landing/Landing'

function App() {
  return (
    <div className="App">
       <Switch>
        <Route exact path="/" component={Landing} />
      </Switch>
    </div>
  );
}

export default App;
